package namit.retail_app.core.data.entityimport android.os.Parcelableimport kotlinx.android.parcel.Parcelizeenum class AddressListType(val value:Int) {    HOME(0), WORK(1), OTHER(2)}data class AddressSearchModel(    var addressName: String? = null,    var addressDetail: String? = null,    var placeID: String? = null)@Parcelizedata class AddressModel(    var id: Int = -1,    var type: AddressListType = AddressListType.HOME,    var landMark: String? = null,    var name: String? = null,    var address: String? = null,    var addressDetail: String? = null,    var phone: String? = null,    var note: String? = null,    var lng: Double = 0.0,    var lat: Double = 0.0,    var isSelected: Boolean = false,    var isSwiped: Boolean = false,    var isDefault: Boolean = false) : Parcelabledata class SearchResultModel(var keyword: String,                             var resultList: List<ProductItem>)